/* eslint-disable no-unused-vars */
/* eslint-disable react-hooks/rules-of-hooks */
/* eslint-disable jsx-a11y/anchor-is-valid */
/* eslint-disable react/button-has-type */
import React from "react";
import { Link } from "react-router-dom";
import * as ROUTES from "../constants/routes";

export default function notFound() {
  return (
    <div className="content-center flex flex-colbg-gray-background">
      <div className="mx-auto max-w-screen-lg place-content-center">
        <p className="text-center text-2xl font-bold">404 Page not found</p>

        <Link
          to={ROUTES.LOGIN}
          className="bg-blue-medium	rounded-full px-8 py-2 text-white"
        >
          TO HOME
        </Link>
      </div>
    </div>
  );
}
